The Football League Show 26.04.2014 

Duration: 1 hour 20 min

As the season heads for a dramatic climax, our feature match comes from Wigan as Uwe Rosler's play-off chasers meet relegation threatened Blackpool. Meanwhile Burnley entertain Ipswich at Turf Moor and Brighton welcome Yeovil to the Amex. The best of the action brought to you by Manish Bhasin.
